import React, { Component } from "react";

export default class LoginUser extends Component {
  render() {
    return (
      <div>
        <form>
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          <label>
            Password:
            <input type="text" name="password" />
          </label>
          <button type="submit" value="Submit" />
        </form>
      </div>
    );
  }
}
